import React, { Component } from 'react';
import { Container, Row, Col } from 'reactstrap';


export default class Footer extends Component {

    render() {
        return (
            <div className="footerComponent">
            <Container>
                <Row>
                    <col md={4}><span className="rulesTitle">Rules of the Game:</span></col> 
                        <col md={{ span: 4, offset: 4 }}><span className="controlsTitle">Controls of the game: </span></col>
                </Row>
            </Container>


            </div>
        )
    }
}
